import {useParams} from  'react-router-dom'

const TaskPage = () => {
    const idQ = useParams();
    const initialList = [{ text: 'Позавтракать', id: 1 }, { text: 'Не опаздать', id: 2 }];
    const task = initialList.find(({id}) => id === +idQ );
    return (
        <div>
            {task.text}
        </div>
    )
}

export default TaskPage;
